package com.tencent.injector;import android.util.Log;import com.tenpay.injector.ILogger;public class TestLogger implements ILogger {    @Override    public String getStartMark() {        return "999999999999> ";    }    @Override    public String getReturnMark() {        return "888888888> ";    }    @Override    public void log(String tag, Object msg) {        Log.i("Debug", msg + "");    }    @Override    public void ret(String className, String methodName, long cost, Object retValue) {        Log.i("Debug", retValue + "");    }}